import React from 'react';
import { Props } from "./type";

const carouselLabel = ({name }: Props)  => {
  if (!name) return null;

  function createMarkup() {
    if (name) return { __html: name };
    else return { __html: "" };
  }
    return (
             <span className="text-label">{name}</span>   
    );
  };

export default carouselLabel;
